import { Link, NavLink } from "react-router-dom";
import styles from "./NavBar.module.css";

const NavBar = () => {
  return (
    <>
      <div>
        <div className="d-md-flex p-3 justify-content-between">
          <div className={styles["nav-item-group-1"]}>
            <NavLink to="/" end>
              Home
            </NavLink>
            <NavLink to="/shop">Shop</NavLink>
          </div>
          <div className={styles["nav-item-group-2"]}>
            <Link to="/">Boutique</Link>
          </div>
          <div className={styles["nav-item-group-3"]}>
            <NavLink to="/cart">Cart</NavLink>
            <NavLink to="/login">Login</NavLink>
          </div>
        </div>
      </div>
    </>
  );
};

export default NavBar;
